import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
import Building from "./building/building";
import axios from "axios";
const emptyclass = () => {
    const navigate = useNavigate();
    function emptyHandler() {
        navigate("/home/")
    }
    function handleLogin(weeknum) {
        if (!protocolAccepted) { // Check if the protocol button has been clicked
            alert("请先接受隐私政策");
            return;
        }
        setBgColor('rgb(111,203,134)');
        const formData = new FormData();
        formData.append("week_num",weeknum );
        axios({
            method: "get",
            url: '/api/empty_room',
            data:formData,
            headers: {
                "Content-Type": 'multipart/form-data',
                "traefik": "jwzx",
            },
        }).then(res => {
            console.log(res);
        }, err => {
            console.log(err)
        });
    }

    return (
        <div id="empty-bg" >
            <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require("./emptypic/returnarrow.png")} id="emparr" /></button>
                空闲教室
            </div>
            <div className="emptychoice">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /></div>
            </div>
            <div id="classchoice">
                <div id="building">
                   <div className="buildingbtndiv"><button id="btnb2" className="buildingbtn">二教</button></div>
                   <div className="buildingbtndiv"><button id="btnb3"className="buildingbtn">三教</button></div>
                   <div className="buildingbtndiv"><button id="btnb4"className="buildingbtn">四教</button></div>
                   <div className="buildingbtndiv"><button id="btnb5"className="buildingbtn">五教</button></div>
                   <div className="buildingbtndiv"><button id="btnb8"className="buildingbtn" onClick={() => handleLogin("第二十周")}>八教</button></div>
                </div>
            </div>
        </div>)
}
export default emptyclass;
